import React, {Component} from 'react'


class Table extends Component{

    
      

render(){
    const divStyle = {
        'overflow-x ':'auto',
        'background-color' : red
       
      };
    return(
<div style={ divStyle}>
<table >
  <tr>
    <th>Nome</th>
    &nbsp;
    <th>Pagamento</th>
  </tr>
  <tr>
    <td>Jill</td>
    
    <td>50</td>
  </tr>
  <tr>
    <td>Eve</td>
    
    <td>94</td>
  </tr>
  <tr>
    <td>John</td>
   
    <td>80</td>
  </tr>
</table>
</div>

    );

}


}


export {Table}
